Fixes issue https://github.com/DefinitelyTyped/DefinitelyTyped/issues/10865.

The DefinitelyTyped/morris.js/morris.js.d.ts file lacks module declaration. Something like the following:

``` typescript
declare module "morris" {
    export = Morris;
}
```

Without these lines, the code like the following in Visual Studio would produce a TS2307 error: `Cannot find module 'morris'`:

``` typescript
import Morris = require("morris");
```

For example the typings for jQuery do define a module: towards the end of the DefinitelyTyped/jquery/jquery.d.ts file.

See https://github.com/mjackson/history/blob/master/docs/GettingStarted.md 

``` javascript
import { createHistory } from 'history'

const history = createHistory()

// Get the current location.
const location = history.getCurrentLocation()
```

case 2. Improvement to existing type definition.
According to the [source code](https://github.com/alexmingoia/koa-router/blob/master/lib/layer.js) of koa-router, `path` parameter is converted by [path-to-regexp](https://github.com/pillarjs/path-to-regexp), which supports both strings and regular expressions.

This enables RegExp path usage like:

``` javascript
router.get(/(^\/$|^\/(?!api))/, async (ctx, next) => {
  ctx.body = 'Hello world';
});
```

case 2. Improvement to existing type definition.

As pointed out in node's [documentation](https://nodejs.org/api/events.html) when doing `require("events")` the class constructor should be obtained and not a namespace containing a single export which is the EventEmitter class. That is, for example 

```
import EventEmitter = require("events");
console.log(EventEmitter.defaultMaxListeners);
var myEmitter = new EventEmitter();
```

should be a piece of code that compiles just fine, but currently it doesn't; This pull request fixes that issue. It was necessary to change the extend clauses of interfaces in other modules to `events` from `events.EventEmitter` . Although `interface foo extends events.EventEmitter` is supposed to work, tsc was complaining(saying events is not a namespace) about it. It didn't do that for the cases where a class extended events.EventEmitter, but anyways events and events.EventEmitter are the same thing in node, so `events` works fine. I am open to suggestions for refactoring they way I did that as I am not convinced this is the best way.

case 2. Improvement to existing type definition.

Add namespace declaration to koa-compress and koa-favicon so we can use ES2015 module syntax like this:

``` javascript
import * as compress from 'koa-compress';
import * as favicon from 'koa-favicon';
```

http.ServerRequest removed in node6 and express actually using IncomingMessage

`"express": "^4.14.0"` source code in express/lib/request.js

```
